import React from "react";
import {
  VictoryBar,
  VictoryChart,
  VictoryAxis,
  VictoryTheme,
  VictoryStack,
} from "victory";

const Graph = (props) => {
  return (
    <VictoryChart domainPadding={20} theme={VictoryTheme.material}>
      <VictoryStack>
        <VictoryBar data={props?.concepts} x="name" y="value" />
      </VictoryStack>
    </VictoryChart>
  );
};
export default Graph;
